import React from 'react'
import './header.css' 
import { Container } from 'reactstrap'
const navLinks =  [

    {
        label: 'Home',
        url: '#'
    },
    {
        label: 'About',
        url: '#'
    },
    {
        label: 'Reservas',
        url: '#'
    },
    {
        label: 'Recipe',
        url: '#'
    },
    {
        label: 'Contact',
        url: '#'
    },

]
const Header = () => {
        return ( 
        <header className="header">
        <Container>
            <div className="navigation">
            <div className="logo" style={{ display: 'flex', alignItems: 'center' }}>
    <img 
        src="https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/cc2672ed-3c69-461c-9f44-7e36253f90e1/dfqacnr-274bb219-ebc2-4ba6-bb42-04cab57d3581.png/v1/fil"
        style={{ width: '100px', height: 'auto', marginRight: '10px' }} // Ajusta el tamaño y el margen según sea necesario
    />
    <h2>
        <span><i className="ri-restaurant-2-fill"></i></span> Federico Fazbear
    </h2>
</div>


                <div className="nav__menu">
            
                    <ul className="nav__list">
                        {
                        navLinks.map((item,index) => (
                            <li className="nav__item" key={index}>
                                <a href={item.url}>{item.label}</a>  
                            </li>
                        ))}
                    </ul>    
                </div>
                <div className="menu_right">
                    <div className="custom__search">
                    <input type="text" placeholder="Search..."/>
                    <span><i class="ri-search-line"></i></span>
                    </div>
                </div>
    
                <div className="mobile_menu">
                    <span><i class="ri-menu-line"></i> </span>
                </div>
            </div>
        </Container>
    
        </header>
    
        )
};

export default Header;
